#define MAX_KV_COUNT      10

struct KeyValInfo{
	char *keyStr[MAX_KV_COUNT];
	int keyLen[MAX_KV_COUNT];
	char *valStr[MAX_KV_COUNT];
	int valLen[MAX_KV_COUNT];
	int count;
};


//key-value:  {"KEY1":"VALUE1","KEY2":"VALUE2"}
bool getKeyValueInfo(const char* src, const char* key, struct KeyValInfo* kvInfo) {
	char* kvStr = strstr(src, key);
	if (kvStr != NULL) {
		int keyLen = strlen(key);
		int kvLen = strlen(kvStr);
		if (keyLen >= kvLen) {
			return false;
		}
		kvInfo->keyStr[kvInfo->count] = kvStr + 1;//kvStr - src + 1;
		kvInfo->keyLen[kvInfo->count] = keyLen - 2; //-2= trim('\"')

		kvStr += keyLen;
		kvLen -= keyLen;
		char* valBegPtr = NULL;
		char* valEndPtr = NULL;
		while(kvLen > 0) {
			if(kvStr[0] == '"') {
				if(valBegPtr == NULL) {
					valBegPtr = kvStr;
				} else {
					valEndPtr = kvStr;
					break;
				}
			} else if(kvStr[0] == '\\') {
				kvLen--;
				kvStr++;
			}
			kvLen--;
			kvStr++;
		}
		if (valBegPtr != NULL && valEndPtr != NULL && valEndPtr > valBegPtr) {
			kvInfo->valStr[kvInfo->count] = valBegPtr + 1;//valBegPtr + 1 - src; //str->str = valBegPtr+1;
			kvInfo->valLen[kvInfo->count] = valEndPtr - valBegPtr - 1; //str->length = valEndPtr - valBegPtr - 1;
			kvInfo->count++;
			return true;
		}

	}//(kvStr != NULL)
	return false;
}

void parseEslEventBody(const char *_body, struct KeyValInfo* kvInfo) {
	kvInfo->count = 0;

	bool ok = getKeyValueInfo(_body, "\"Event-Name\"", kvInfo);
	if (ok == true) {
		const char* evtStr = kvInfo->valStr[0];
		int evtStrLen = kvInfo->valLen[0];
		
		getKeyValueInfo(_body, "\"variable_ccod_channel_uuid\"", kvInfo);
		getKeyValueInfo(_body, "\"Unique-ID\"", kvInfo);

		if (strncmp(evtStr, "CHANNEL_EXECUTE_COMPLETE", evtStrLen) == 0) {
			getKeyValueInfo(_body, "\"Application\"", kvInfo);
			getKeyValueInfo(_body, "\"Application-Response\"", kvInfo);
		} else if (strncmp(evtStr, "PLAYBACK_STOP", evtStrLen) == 0) {
			getKeyValueInfo(_body, "\"Playback-File-Path\"", kvInfo);
		} else if (strncmp(evtStr, "RECORD_STOP", evtStrLen) == 0) {
			getKeyValueInfo(_body, "\"Record-File-Path\"", kvInfo);
			getKeyValueInfo(_body, "\"Event-Calling-Function\"", kvInfo);
		} else if (strncmp(evtStr, "DTMF", evtStrLen) == 0) {
			getKeyValueInfo(_body, "\"DTMF-Digit\"", kvInfo);
		} else if (strncmp(evtStr, "BACKGROUND_JOB", evtStrLen) == 0) {
			getKeyValueInfo(_body, "\"Job-UUID\"", kvInfo);
			getKeyValueInfo(_body, "\"Job-Command\"", kvInfo);
			getKeyValueInfo(_body, "\"Job-Command-Arg\"", kvInfo);
			getKeyValueInfo(_body, "\"_body\"", kvInfo);
		} else if (strncmp(evtStr, "CHANNEL_CREATE", evtStrLen) == 0) {
			getKeyValueInfo(_body, "\"Caller-Direction\"", kvInfo);
			//if (strncmp(str.str, "inbound", str.length) == 0) {
			getKeyValueInfo(_body, "\"Caller-Caller-ID-Number\"", kvInfo);
			getKeyValueInfo(_body, "\"Caller-Destination-Number\"", kvInfo);
			getKeyValueInfo(_body, "\"Caller-Orig-Caller-ID-Number\"", kvInfo);
			//}
		} else if (strncmp(evtStr, "DETECTED_SPEECH", evtStrLen) == 0) {
			getKeyValueInfo(_body, "\"Speech-Type\"", kvInfo);
			getKeyValueInfo(_body, "\"_body\"", kvInfo);
		} else if (strncmp(evtStr, "CHANNEL_UNBRIDGE", evtStrLen) == 0) {
			getKeyValueInfo(_body, "\"Bridge-A-Unique-ID\"", kvInfo);
			getKeyValueInfo(_body, "\"Bridge-B-Unique-ID\"", kvInfo);
			getKeyValueInfo(_body, "\"Caller-Transfer-Source\"", kvInfo);
		} else if (strncmp(evtStr, "CUSTOM", evtStrLen) == 0) {
			getKeyValueInfo(_body, "\"Event-Subclass\"", kvInfo);
			getKeyValueInfo(_body, "\"Action\"", kvInfo);
			getKeyValueInfo(_body, "\"Conference-Name\"", kvInfo);
		}
	}
}

void checkChannelCreateKV(const char* _body, struct KeyValInfo* kvInfo) {
	const char* keys[] = {
		"Event-Name",
		"variable_ccod_channel_uuid",
		"Unique-ID",
		"Caller-Direction",
		"Caller-Caller-ID-Number",
		"Caller-Destination-Number",
		"Caller-Orig-Caller-ID-Number",
	};

	const char* vals[] = {
		"CHANNEL_CREATE",
		"000000010001",
		"6b8720d5-f692-4600-918c-5028380d15f1",
		"outbound",
		"0000000000",
		"10001",
		"0000000000",
    };
    
	char keystr[100] = {'\0'};
	char valstr[100] = {'\0'};
	
	if (kvInfo->count != 7) {
		printf("ERR: params.count=%d required=3\n", kvInfo->count);
		return;
	}
	
	for (int i = 0; i < kvInfo->count; i++) {
		strncpy(keystr, kvInfo->keyStr[i], kvInfo->keyLen[i]);
		keystr[kvInfo->keyLen[i]] = '\0';
		strncpy(valstr, kvInfo->valStr[i], kvInfo->valLen[i]);
		valstr[kvInfo->valLen[i]] = '\0';
		if (strncmp(kvInfo->keyStr[i], keys[i], kvInfo->keyLen[i]) != 0) {
	    		printf("ERR: key=%s required=%s\n", keystr, keys[i]);
    			return;
		} else {
			if (strncmp(kvInfo->valStr[i], vals[i], kvInfo->valLen[i]) != 0) {
				printf("ERR: value=%s required=%s\n", valstr, vals[i]);
				return;
			}
		}
		printf("OK: key=%s value=%s\n", keystr, valstr);
	}
}

void parseByCJson(const char *_body){

    cJSON *root, *jsonObj;
    root = cJSON_Parse(_body);
    jsonObj = root;
    while(jsonObj) 
    {
        switch((jsonObj->type)&255)
        {
            case cJSON_String:
            {
                char *k = jsonObj->string; 
                char *v = jsonObj->valuestring;
                //printf("%s : %s\n", k, v);
                jsonObj= jsonObj->next;
                break;
            }
            case cJSON_Object: { jsonObj = jsonObj->child; break;}
            case cJSON_NULL: 
            case cJSON_False:   
            case cJSON_True:
            case cJSON_Number:
            case cJSON_Array: 
            default: { jsonObj = NULL; break;}
        }
    }
    if(root) cJSON_Delete(root);
    root = NULL;
}

